import classes from "./../../css/Header.module.css";

const Header = () => {
	return (
		<header className={classes.header}>
			<img src='https://programmi-dlya-android.ru/wp-content/uploads/2022/10/programmisty_emiasapp.png' alt="logo"/>
		</header>
	);
}

export default Header;
